import React from 'react';
import Col from './Col.js';
import Button from './Button.js';



export class Row extends React.Component{
    constructor(props){
        super(props);
    }
    //props:
    //props are the Host data points and match the data point names

    render(){
      const bookButtonAttr={
        'type':"button",
        'class':"btn btn-primary"
      }
      const bookButtonLabel="Book";

        return(

            <div key={this.props.id}>
				<li className="list-group-item">
					<div className="media">
						<div className="media-body">
							<h4 className="mt-0">{this.props.firstName}</h4>
							<div className="container">
								<div className="row">
                                    <Col dataDisplay={this.props.street} gIcon = "glyphicon-map-marker"/>

                                    <Col dataDisplay={this.props.spaceType} gIcon = "glyphicon-home"/>
								</div>
								<div className="row">
                                    <Col dataDisplay={this.props.pricePerSq + "/sqInch"} gIcon = "glyphicon-usd"/>

                                    <Col dataDisplay="8:00AM - 12:00PM (Monday-Friday)" gIcon = "glyphicon-time"/>

								</div>
								<div className="row">
                                    <Col dataDisplay={this.props.spaceAvailable + "sq. ft remaining"} gIcon = "glyphicon-resize-horizontal"/>

                                    <Col dataDisplay="OpenSpace Verified" gIcon = "glyphicon-ok-circle"/>
								</div>
							</div>
						</div>
            <a href="/BookASpace"><Button attr={bookButtonAttr} label={bookButtonLabel}/></a>
					</div>
				</li>
			</div>

        );
    }


}
export default Row;
